INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(1, 'Ингавирин, капсулы 90мг, 10 шт', 1, 'Фармакологическое действие\r\nОказывает противовирусное действие, эффективен в отношении вирусов гриппа А, аденовирусной инфекции. Оказывает модулирующее действие на функциональную активность системы интерферона: вызывает повышение содержания интерферона в крови до физиологической нормы, стимулирует и нормализует сниженную альфа - интерферон продуцирующую способность лейкоцитов крови, стимулирует Y - интерферон продуцирующую способность лейкоцитов. Ускоряет дифференцировку и функциональное созревание нейтрофилов. Гематопротекторный эффект препарата при миелосупрессивной химиотерапии обусловлен ускорением созревания предшественников нейтрофильных гранулоцитов на стадии образования специфических гранул. В результате чего происходит уменьшение степени и частоты токсической нейтропении III-IV степени. Вызывает уменьшение частоты возникновения лимитирующей лейко и нейтропении. Препарат не обладает мутагенным и канцерогенным действием, не влияет на репродуктивную функцию, не обладает иммунотоксическими и аллергизирующими свойствами, не оказывает местнораздражающего действия. Равномерно распределяется по внутренним органам. Максимальные концентрации в крови, плазме крови и большинства органов достигаются через 30 минут. Препарат выводится в неизменном виде.\r\n\r\nПоказания к применению\r\nИнгавирин: Лечение гриппа. При необходимости сочетать с приемом симптоматических средств. Дикарбамин: Гематопротекция у больных, получающих химиотерапию цитотоксическими средствами по поводу злокачественных новообразований.\r\n\r\nПротивопоказания\r\nИндивидуальная непереносимость имидазолилэтанамида пентандиовой кислоты, беременность, лактация, детский возраст до 18 лет.\r\n\r\nПобочное действие\r\nАллергические реакции.\r\n\r\nВзаимодействие\r\nИмидазолилэтанамид пентандиовой кислоты усиливает противоопухолевое действие цитостатиков. Кроме того, имидазолилэтанамид пентандиовой кислоты снижает токсический эффект циклофосфамида и его комбинаций с препаратами платины.\r\n\r\nПередозировка\r\nСпецифический антидот к имидазолилэтанамиду пентандиовой кислоты не известен.\r\n\r\nСпособ применения и дозировка\r\nВнутрь независимо от приема пищи. По 90 мг 1 раз в день, 5 дней. Прием препарата начинают с момента появления первых симптомах заболевания, не позднее 36 часов от начала болезни.\r\n\r\nОсобые указания\r\nПрепарат не оказывает седативного действия, не влияет на скорость психомоторной реакции и может использоваться у лиц различных профессий, в т.ч. требующих повышенного внимания и координации движений. Не рекомендуется одновременный прием других противовирусных препаратов.\r\n\r\nУсловия хранения\r\nХранить в сухом, защищенном от света месте при температуре не выше 25 гр. С. Хранить в недоступном для детей месте.', , 819, 12, 'Россия', 'Валента Фармацевтика ОАО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(2, 'Аципол, капсулы 30 шт', 1, 'Лекарственная форма\r\nСодержимое капсул - сухая биомасса от светло-кремового до кремового цвета с кисломолочным запахом.\r\nСостав\r\nПрепарат представляет собой лиофилизированную в среде культивирования смесь микробной массы живых антагонистически активных ацидофильных лактобацилл и инактивированных прогреванием кефирных грибков, содержащих водорастворимый полисахарид, подвергнутых измельчению, расфасованную в капсулы.\r\nВ 1 капсуле содержится не менее 107 живых ацидофильных лактобацилл и полисахарида кефирного грибка - 0,4 мг.\r\nФармакотерапевтическая группа\r\nэубиотик\r\n\r\nТемпература хранения\r\nот 2℃ до 10℃\r\n\r\nОсобые условия\r\nНЕ ПРИГОДЕН ДЛЯ ПРИМЕНЕНИЯ:\r\n1) Препарат, целостность внутренней упаковки которого нарушена (треснувшие банки, блистерная упаковка);\r\n2) Препарат без маркировки или с нечеткой маркировкой;\r\n3) Препарат с измененными физическими свойствами (нарушена форма капсулы), при наличии посторонних включений;\r\n4) Препарат с истекшим сроком годности.\r\n\r\nФармакодинамика\r\nПрепарат представляет собой лиофилизированную в среде культивирования смесь микробной массы живых антагонистически активных ацидофильных лактобацилл и инактивированных прогреванием кефирных грибков, содержащих водорастворимый полисахарид, подвергнутых измельчению, расфасованную в капсулы.\r\nВ 1 капсуле содержится не менее 107 живых ацидофильных лактобацилл и полисахарида кефирного грибка - 0,4 мг.\r\nТерапевтический эффект Аципола® определяют содержащиеся в нем живые ацидофильные лактобациллы и полисахарид кефирных грибков. По механизму действия Аципол® является многофакторным лечебным средством, обладает антагонистической активностью в отношении патогенных и условнопатогенных микроорганизмов, оказывает корригирующее действие на микрофлору кишечника, повышает иммунологическую реактивность организма.\r\nПоказания\r\n\r\nНазначение:\r\nПрофилактика и лечение заболеваний желудочно-кишечного тракта, у детей с 3-х месячного возраста и взрослых; в сочетании с традиционным лечением.\r\n\r\nПоказание к применению\r\nДисбактериоз и состояния, приводящие к его развитию:\r\n- острые кишечные инфекции (дизентерия,сальмонеллез,ротавирусный гастроэнтерит и др.);\r\n- хронические колиты, энтероколиты инфекционного и неинфекционного происхождения;\r\n- длительная антибактериальная терапия.\r\n\r\nДисбактериоз и отставание в весе, связанные с:\r\n- активной антибиотикотерапией гнойно-септических заболеваний у грудных детей;\r\n- хроническими, затяжными, рецидивирующими патологиями органов дыхания (бронхиты, пневмонии, в том числе, пневмоцистные);\r\n- атопическим дерматитом и другими аллергическими проявлениями.\r\nПрофилактика дисбактериоза\r\n- повышение общей резистентности организма.\r\n\r\nПротивопоказания\r\nПовышенная чувствительность к компонентам препарата\r\n\r\nПобочные действия\r\nНе установлены.\r\n\r\nОсобые условия хранения\r\nХранение и транспортирование в соответствии с СП 3.3.2.1248-03 при температуре не выше 10С', , 508, 34, 'Россия', 'ЛЕККО ФФ ЗАО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(3, 'Ринза, таблетки 10 шт', 1, 'Группа\r\nКомбинации парацетамола и Н1-гистаминоблокаторов\r\nМеждународное непатентованное название\r\nКофеин+Парацетамол+Фенилэфрин+Хлорфенамин\r\nСостав\r\nКофеин+Парацетамол+Хлорфенамин+Фенилэфрин.\r\nПроизводители\r\nЮник Фармасьютикал Лабораториз (Индия), Юник Фармасьютикал Лабораториз (отдел. фирмы Дж.Б.Кемикалс энд Фармасьютикалс) (Индия)\r\nФармакологическое действие\r\nКомбинированное средство, оказывает жаропонижающее, анальгезирующее, альфа-адреностимулирующее, вазоконстрикторное и антигистаминное действие, устраняет симптомы \"простуды\".\r\nПобочное действие\r\nАллергические реакции, тошнота, эпигастральная боль, анемия, тромбоцитопения, агранулоцитоз, повышенная возбудимость, головокружение, повышение АД, нарушение засыпания. Мидриаз, парез аккомодации, повышение внутриглазного давления, сухость во рту; задержка мочи. При длительном применении в больших дозах - гепатотоксическое действие, гемолитическая или апластическая анемия, метгемоглобинемия, панцитопения; нефротоксичность.\r\nПоказания к применению\r\nЛихорадочный синдром (\"простудные\" и инфекционные заболевания); синусит, ринорея (острый ринит, аллергический ринит).\r\nПротивопоказания\r\nГиперчувствительность, выраженный атеросклероз коронарных артерий, артериальная гипертензия, ИБС, тяжелые формы сахарного диабета, гиперплазия предстательной железы, гипертиреоз, повышенное внутриглазное давление, беременность, период лактации, детский возраст до 6 лет. C осторожностью: дефицит глюкозо-6-фосфатдегидрогеназы; печеночная и/или почечная недостаточность, врожденные гипербилирубинемии, ХОБЛ, одновременный прием ингибиторов МАО и бета-адреноблокаторов.\r\nСпособ применения и дозировка\r\nВзрослым назначают по 1 тб. 3 раза в сутки.\r\nПередозировка\r\nСимптомы: бледность кожных покровов, снижение аппетита, тошнота, рвота, токсический гепатит, вплоть до развития гепатонекроза, повышение активности \"печеночных\" трансаминаз, увеличение протромбинового времени. Лечение: симптоматическое.\r\nВзаимодействие\r\nУсиливает эффекты ингибиторов МАО, седативных ЛС, этанола. Этанол усиливает седативное действие антигистаминных ЛС. Антидепрессанты, противопаркинсонические и антипсихотические ЛС, фенотиазиновые производные повышают риск развития задержки мочи, сухости во рту, запоров. ГКС увеличивают риск развития глаукомы. Парацетамол снижает эффективность урикозурических ЛС. Хлорфенамин одновременно с ингибиторами МАО, фуразолидоном может привести к гипертоническому кризу, возбуждению, гиперпирексии. Трициклические антидепрессанты усиливают адреномиметическое действие фенилэфрина. Снижает гипотензивное действие гуанетидина, который в свою очередь усиливает альфа-адреностимулирующую активность фенилэфрина.\r\nОсобые указания\r\nВ период лечения проводят контроль показателей периферической крови и функционального состояния печени. В период лечения нельзя принимать снотворные и анксиолитические ЛС (транквилизаторы). Не принимать вместе с другие ЛС, содержащими парацетамол. В период лечения необходимо воздерживаться от употребления этанола, вождения автотранспорта и занятий др. потенциально опасными видами деятельности, требующими повышенной концентрации внимания и быстроты психомоторных реакций.\r\nУсловия хранения\r\nСписок Б. При комнатной температуре.\r\nПорядок отпуска\r\nОтпускается без рецепта  ', , 275, 38, 'Индия', 'Юник Фармасьютикал');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(4, 'Фермент форте Консумед (Consumed), таблетки 50 шт БАД', 1, 'Фермент форте табл. №50\r\nФермент форте содержит панкреатин и биотин, которые способствуют нормализации пищеварения.\r\n\r\nПанкреатин - фармакологическое действие — восполняющее дефицит ферментов поджелудочной железы. Входящие в состав препарата амилаза, липаза и протеаза облегчают переваривание углеводов, жиров и белков, способствуя более полному их всасыванию в тонком кишечнике.\r\n\r\n\r\nБиотин (витамин В7) входит в состав ферментов, участвующих в метаболизме глюкозы: пируватдегидрогеназы и транскетолазы. Биотин способствует образованию жирных кислот, поддерживает метаболизм аминокислот и углеводов, нормальное функционирование потовых желез, нервной ткани, костного мозга, клеток кожи и волос, минимизирует симптомы дефицита цинка.\r\n\r\n\r\n\r\nБАД. НЕ ЯВЛЯЕТСЯ ЛЕКАРСТВОМ. ПЕРЕД ПРИМЕНЕНИЕМ НЕОБХОДИМО ПРОКОНСУЛЬТИРОВАТЬСЯ СО СПЕЦИАЛИСТОМ.\r\nсостав\r\nПанкреатин, биотин, Е460, Е551, Е470, Е1201, оболочка таблетки (Е464, Е1521, Е171, Е120).\r\n\r\nОграничения к применению\r\nИндивидуальная непереносимость компонентов, беременность, кормление грудью.\r\n\r\nСпособ применения\r\nВзрослым принимать по 1-2 таблетки 3 раза в день во время еды.\r\nПродолжительность приема 1-2 месяца.\r\n\r\nУсловия отпуска из аптек\r\nОтпускается без рецепта врача.', , 150, NULL, 'Россия', 'Квадрат-С ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(5, 'Контейнер для биоматериала стерильный, 100мл завинчивающаяся крышка', 2, 'Контейнер д/биомат. стер 100мл завин. крышка\r\n\r\nЛекарственная форма\r\n\r\nбанка полимерная д/биоматериала с винтовой навинчивающейся крышкой\r\n\r\nСостав\r\n\r\nполимер\r\n\r\nФармакологическое действие\r\n\r\nКонтейнер с завинчивающейся крышкой, изготовленный из прочного полипропилена, для хранения образцов биоматериалов.\r\n\r\nПри комнатной температуре химически устойчив ко всем, часто используемым, лабораторным реагентам.\r\n\r\nОсобые условия\r\n\r\nВнимание! После однократного применения контейнер утилизируется\r\n\r\nПоказания\r\n\r\nдля взятия пробы биоматериала\r\n\r\nДозировка\r\nСразу после сбора биоматериала (кала или мочи) контейнер плотно закройте завинчивающейся крышкой', , 30, NULL, 'Россия', 'Еврокэп');
