(6, 'Бахилы медицинские полиэтиленовые повышенной прочности, 5 пар', 2, 'широко бахилы используются в больничных и детских учреждениях, а также в местах, где используется сменная обувь общего пользования\r\n\r\nПоказания\r\n\r\nв целях соблюдения чистоты и поддержания санитарных норм во всех помещениях, где недопустимо появление уличной грязи', , 25, NULL, 'Россия', 'Элегрин');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(7, 'Маска медицинская трехслойная UP&GO на резинке, 5 шт', 2, 'Индивидуальная упаковка с пятью медицинскими масками внутри. Не стерильна. При изготовлении использовался трехслойный синтетический материал SMS (первый и третий слой – спанбонд, средний – мелтбутан). По характеристикам превосходит большинство аналогов (например, марлевые повязки и маски с воздушным фильтром).', , 45, NULL, 'Россия', 'Эвтекс ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(8, 'Перчатки UP&GO смотр. нитрил. неопуд. нестер. р.L №5', 2, 'Применение\r\nДостать перчатки из упаковки, надеть на руки. Учитывать размер.\r\nСвойства:\r\nХорошо и плотно облегают руку. Высокопрочны, обеспечивают максимальную защиту и комфорт. Подходят на правую и левую руку.\r\nМеры предосторожности:\r\nПерчатки не предназначены для работы с ядовитыми и раздражающими химическими веществами.\r\nУсловия хранения:\r\nХранить при температуре от +10 до +30С и влажности не выше 80%. Избегать попадания прямых солнечных лучей или люминесцентного освещения на открытую упаковку.\r\nСрок годности 5лет\r\nКоличество 10штук', , 155, NULL, ' Малайзия', 'ТопГлав');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(9, 'Little hands (Литл Хэндс), крем детский увлажняющий с Пантенолом, 75мл', 3, 'Описание:\r\nКрем увлажняющий детский с пантенолом — средство первой необходимости для каждого малыша. Крем обогащен натуральными экстрактами лаванды, ромашки и календулы. Пантенол в составе крема обладает увлажняющим и смягчающим действием. Помогает устранить покраснение, раздражение и шелушение. Благодаря содержанию масла ши и масла подсолнечника, обеспечивает глубокое увлажнение кожи малыша.\r\nСостав:\r\nAqua, Glycerin, Dibutyl Adipate, Glyceryl Stearate, Caprylic/Capric Triglyceride, Cetearyl Alcohol, Hexyldecanol, Hexyldecyl Laurate, Helianthus Annuus Seed Oil, Butyrospermum Parkii Butter, Panthenol, Lavandula Intermedia (Lavender) Flower/Leaf/Stem Extract, Calendula Officinalis Flower Extract, Chamomilla Recutita Flower Extract, Disodium Cetearyl Sulfosuccinate, Sodium Polyacrylate, Xanthan Gum, Propylene Glycol, Benzyl Alcohol, Glyceryl Laurate, Pentaerythrityl Tetra-di-t-butyl Hydroxyhydrocinnamate, Parfum*.\r\nСпособ применения: нанесите небольшое количество крема на чистую сухую кожу малыша и распределите легкими массажными движениями до полного впитывания.\r\nМеры предосторожности: возможна индивидуальная непереносимость отдельных компонентов.\r\nСтрана производства : Россия', , 129, NULL, 'Россия', 'УНИК косметик ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(10, 'Салфетки влажные Консумед (Consumed) детские с экстрактом ромашки и календулы, 80 шт', 3, 'Влажные салфетки детские 80 шт с экстрактом ромашки и календулы с пластиковым клапаном\r\nСпособ применения и дозы\r\nОткрыть клапан, аккуратно извлечь салфетку, закрыть клапан. Закрывайте клапан после каждого применения, чтобы предотвратить высыхание салфеток. Салфетки предназначены для одноразового использования, только для наружного применения.\r\n\r\nМеры предосторожности: не допускать попадания в глаза, рот и на поврежденные участки кожи, в случае попадания промыть водой. При обнаружении повышенной индивидуальной чувствительности к компонентам лосьона рекомендуется прекратить использование.', , 139, NULL, 'Россия', 'Гранд А.В.');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(11, 'Бутылочка для кормления с соской молочной силиконовой Дино и Рино (Dino & Rhino), 250мл', 3, 'Состав:\r\nёмкость, кольцо, колпачок, заглушка, соска. Материал: полипропилен, силикон. Не содержит бисфенол-А\r\n\r\nНе содержит бисфенол-А\r\nСделано в России!\r\nБутылочка для кормления в комплекте с силиконовой молочной соской (размер S, малый поток) предназначена для кормления вашего малыша с 0 месяцев.\r\nОснащена выпуклой шкалой с удобным шагом - 30 мл.\r\n\r\nИспользование и уход: перед использованием изделие необходимо прокипятить в открытой посуде в течение 3-х минут. После кормления промыть изделие теплой водой с мылом и тщательно ополоснуть. Бутылочка подходит для разогревания детского питания в микроволновой печи или подогревателе. Разогревайте бутылочку в микроволновой печи не более 1 мин. и только в открытом виде, без соски, кольца и колпачка.\r\nВнимание!!! Проверяйте изделие перед каждым использованием. При выявлении дефектов, а также после истечения срока службы, изделие необходимо заменить! Не оставляйте ребенка одного во время кормления и храните в недоступных для детей местах. Сохраняйте упаковку, т.к. она несет важную информацию.', , 205, NULL, 'Россия', 'Компания и К, ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(12, 'Подгузники для детей Дино и Рино (Dino & Rhino) размер MIDI 4-9 кг, 22 шт', 3, 'Состав:\r\nцеллюлоза, нетканый материал, суперабсорбент, полиэтилен, клеевой расплав.\r\n\r\nПодгузники Dino&Rhino MINI со специальными впитывающими каналами разработаны для комфорта ваших малышей. Они обеспечивают сухость без протечек и провисания между ножек. Впитывающие каналы равномерно распределяют влагу, поэтому она быстро впитывается и надежно блокируется внутри. Специальная U-форма канала позволяет жидкости распределиться от задней части подгузника к передней, что важно в периоды сниженной активности ребенка. Мягкие эластичные боковинки подгузника обеспечивают отличное прилегание, не стесняя движений и не натирая нежную кожу ребенка. Высокие эластичные бортики вокруг ножек удерживают содержимое подгузника внутри, исключая протекания. Благодаря дышащему внешнему слою, подгузник обеспечивает постоянный доступ воздуха к коже малыша. Многоразовые липучки гарантируют удобство в использовании.\r\n\r\nОсобенности:\r\n    подгузники без провисания Комфортная посадка подгузника — активное движение малыша без неудобств.\r\n    подгузники быстрое впитывание Впитывают за секунды. Никаких мокрых попок и неудобных комков!\r\n    все дышащие Нет образованию опрелостей и раздражению нежной кожи! Циркуляция воздуха также препятствует нарушению теплообмена.\r\n    подгузники легко снимать и надевать Многоразовые липучки — это что-то новенькое! Снимайте и надевайте подгузники Дино&Рино размер МИНИ несколько раз: какая экономия!\r\n    все нежные как хлопок Малышам только самое лучшее! Мягкие как мамины ручки.\r\n    подгузники распределение влаги Уникальная U-форма канала — жидкость распределяется равномерно даже во время сна. И у мальчиков, и у девочек.\r\n\r\nРекомендации по использованию: разверните подгузник, поднимите вертикально бортики, разверните боковинки и застежки-липучки, после чего симметрично закрепите их на ленте на передней части подгузника. Застежки-липучки можно многократно отстегивать и застегивать. Рекомендуется менять подгузник не менее 4-6 раз в день.', , 395, NULL, 'Россия', ' Онтэкс РУ, ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(13, 'Шалфея листья, фильтр-пакеты 1,5г, 20 шт БАД', 4, 'Состав:\r\nлистья шалфея лекарственного\r\n\r\nОписание:\r\nНастой шалфея показан в комплексной терапии, как средство для полоскания горла при ангинах и фарингитах. Шалфей содержит эфирное масло, богатое камфарой, цинеолом, пиненами, дубильными веществами, и за счет этого оказывает свой лечебный эффект. Также шалфей помогает и при воспалениях десен и слизистых полости рта - гингивитах, стоматитах. В этом случае назначаются полоскания. Фармакологическое действие: настой листьев шалфея оказывает противомикробное, противовоспалительное и вяжущее действие. Применяется в комплексной терапии воспалительных заболеваний полости рта (стоматит, гингивит), глотки (ангина, фарингит). Трава измельченная\r\n\r\nОсобые условия Перед применением рекомендуется проконсультироваться с врачом.\r\n\r\nПоказания:\r\nДля реализации населению в качестве биологически активной добавки к пище - источника флавоноидов, полифенольных соединений, содержащей эфирные масла.\r\n\r\nПротивопоказания:\r\nиндивидуальная непереносимость компонентов, беременность, кормление грудью.', , 89, NULL, 'Россия', ' СТ-Медифарм');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(14, 'Ромашки аптечной цветки, фильтр-пакеты 1,5г, 20 шт БАД', 4, 'Ромашка аптечная цветки, ф/пак 1.5г №20_БАД, СТМ\r\nСостав\r\nИзмельченные цветки ромашки.\r\nПоказания к применению\r\nРекомендуется в качестве биологически активной добавки к пище - источника флавоноидов, содержащей эфирное масло.\r\nПротивопоказания\r\nИндивидуальная непереносимость компонентов, беременность, кормление грудью. Перед применением рекомендуется проконсультироваться с врачом.\r\nСпособ применения и дозы\r\n1 фильтр-пакет (1,5 г) сырья залить 200 мл кипятка, настоять 20 минут, фильтр-пакет отжать. Принимать взрослым по 1/2 стакана 2 раза в день во время еды.\r\nУсловия хранения\r\nХранить в сухом, защищенном от прямых солнечных лучей, недоступном для детей месте при температуре не выше 25°С. Готовый настой хранить в холодильнике не более 2-х суток.', , 78, NULL, 'Россия', 'СТ-Медифарм ');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(15, 'Сбор Бруснифит травяной, фильтр-пакеты 2г, 20 шт БАД', 4, 'Травяной сбор «Бруснифит» содержит растительный комплекс, обладающий поддерживающим мочевыводящую систему действием. Листья брусники и череда имеют антисептический, мочегонный и желчегонный эффекты. Плоды шиповника способствуют усилению защитных функций организма. Зверобой отличается выраженными вяжущими и противовоспалительными свойствами. Ингредиенты сбора «Бруснифит» выращены на экологически чистых территориях методом органического земледелия (без использования синтетических удобрений, химикатов и инсектицидов). Соответствие международным стандартам подтверждает 100 % натуральность состава. Без искусственных ароматизаторов, красителей и ГМО. Не содержит сахара и кофеина.\r\nПоказания\r\n\r\nВ качестве биологически активной добавки к пище – источника арбутина, гиперицина и флавоноидов.\r\nСпособ применения и дозировка\r\n\r\n1 фильтр-пакет (2,0 г) залить 1 стаканом (200 мл) кипятка, настоять 15 минут, фильтр-пакет отжать. Принимать взрослым по 1/2 стакана в день во время еды. Продолжительность приема 2-3 недели. При необходимости прием можно повторять 3-4 раза в год.', , 97, NULL, 'Россия', 'СТ-Медифарм');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(16, 'Сбор Успокоительный Спокойной ночи, фильтр-пакеты 2г, 20 шт БАД', 4, 'СБОР УСПОКОИТЕЛЬНЫЙ №2, Ф/П ПО 2,0Г №20\r\nСостав: Гибискуса цветки, Мяты перечной листья, Хмеля шишки, Валериана с корнями и корневищем, Пустырника трава, Солодки корни\r\nСвойства: Успокаивает, улучшает засыпание, уменьшает спастические головные боли, мягко понижает АД.\r\nГибискуса цветки способствуют улучшению общего самочувствия;\r\nнормализуют артериальное давление, нормализуют эмоциональный фон;\r\nукрепляют стенки кровеносных сосудов\r\nЭфирное мятное масло обладает антимикробными свойствами; действует успокаивающее на НС;\r\nспособно уменьшить головную боль при мигрени.\r\nУкрепляе стенки кровеносных сосудов\r\nХмеля шишки обладают успокоительным и снотворным эффектом.\r\nВалериана с корнями и корневищем снимает возбудимость коры головного мозга, уменьшает вегето-сосудистые расстройства, улучшает коронарное кровообращение\r\nПустырника трава оказывает успокаивающее действие, понижает\r\nартериальное давление (АД), замедляет ритм сердечных сокращений,\r\nобладает противосудорожной активностью.\r\nСолодки корни способны повысить тонус ЦНС и снизить усталость;\r\nнормализовать сон.\r\nПреимущества: Рациональный состав натурального травяного сбора, оказывающий успокаивающее действие на организм\r\nПрименение: Взрослым по 1 стакану в день во время вечернего приёма пищи', , 87, NULL, 'Россия', 'СТ-Медифарм');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(17, 'Пульсоксиметр B.Well MED-320, 1 шт', 5, 'Пульсоксиметр B.Well MED-320\r\nТочный и быстрый прибор для измерения оксигенации ─ уровня насыщенности крови кислородом ─ должен быть в каждой семье.\r\n\r\nПульсоксиметр B.Well MED-320 надевается на палец; это простое и компактное устройство, которым удобно пользоваться дома или брать с собой. С его помощью можно контролировать уровень SpO2  отслеживать динамику изменения оксигенации и держать болезнь под контролем.\r\n\r\nПреимущества пульсоксиметра B.Well MED-320\r\nИзмерение оксигенации и пульса;\r\nНа дисплей выводятся одновременно SpO2, пульс, гистограмма и график пульса;\r\nТочный результат за считаные секунды;\r\nАвтоповорот ─ направление дисплея меняется автоматически;\r\nЯркость дисплея можно регулировать;\r\nУправляется одной кнопкой;\r\nКомпактный размер, низкое энергопотребление;\r\nВ комплекте ─ сумка-чехол, шнурок и 2 батареи типа ААА.\r\nТехнические характеристики\r\nДисплей ─  SpO2, пульс, гистограмма и график пульса;\r\nАвтоповорот дисплея;\r\nРегулируемая яркость дисплея;\r\nАвтоматическое отключение;\r\nИндикатор низкого заряда батарей;\r\nИсточник питания ─ 2 батареи 1,5В типа ААА;\r\nРазмеры ─ 57 x 31 x 32 мм;\r\nВес ─ около 50 г (включая батарейки).\r\n\r\nКомплектация\r\nПульсоксиметр;\r\nЭлементы питания ─ 2 батареи 1,5В типа ААА;\r\nШнурок;\r\nСумка-чехол;\r\nРуководство по эксплуатации с гарантийным талоном;\r\nКоробка.\r\n', , 1386, NULL, 'Швейцария', 'Би Велл'),
(18, 'Термометр цифровой, медицинский AMDT 10 Консумед (Consumed)', 5, 'Термометр электронный модель AMDT-10\r\nТермометр медицинский цифровой AMDT10 предназначен для измерения температуры тела человека пациентом в домашних условиях и медицинским работником в лечебных учреждениях.\r\n\r\nОн отличается от классического стеклянного ртутного термометра: обладает высоким быстродействием и точностью, сохраняет в памяти результат предыдущего измерения, подает звуковой сигнал при включении, повышенной температуре и окончании измерения; не содержит ртути.\r\nПРОЦЕДУРА ИЗМЕРЕНИЯ ТЕМПЕРАТУРЫ\r\n\r\n1. Перед использованием термометра продезинфицируйте его салфеткой со спиртосодержащей жидкостью.\r\n\r\n2. Нажмите кнопку ВКЛ/ВЫКЛ. После звукового сигнала на дисплее последовательно отобразятся: 188.8°Е\"результат предыдущего измерения\"37°С\"Lo°C. (при температуре в помещении выше 32°С символ Lo°C может не появиться). Мигающая часть °С символа Lo°C означает начало измерения температуры. Приступайте к измерению согласно выбранному способу.\r\n\r\n3. Способы измерения температуры. Оральное измерение. Быстрое измерение температуры у взрослых.\r\n-Удобно разместите наконечник термометра во рту, плотно прижав его языком. Ректальное измерение. Рекомендуется для измерения температуры у маленьких детей. Дает наиболее точные результаты измерения температуры.\r\n- Осторожно введите наконечник термометра на несколько миллиметров в анальное отверстие. При ощущении сопротивления немедленно прекратите процедуру. Аксиллярное измерение. Наименее точный способ измерения температуры. - Разместите наконечник термометра в середине подмышечной впадины и плотно прижмите его рукой. После подачи прерывистого звукового сигнала продолжайте измерение в течение 3-4 минут.\r\n\r\n4. После завершения измерения подается звуковой сигнал, прекращается мигание символа °С, на дисплее отображается результат измерения температуры. При аксиллярном способе измерения звуковой сигнал не означает окончания измерения. Результаты измерения, полученные вышеперечисленными способами, будут отличаться на 0,1 0,5°С, т.к. температура в различных точках тела не одинакова.\r\n\r\n5. Термометр автоматически отключится через 9 минут после окончания измерения. Для увеличения срока службы источника питания рекомендуется принудительно выключить термометр, нажав кнопку ВКЛ/ВЫКЛ.\r\n\r\n6. После использования термометра протрите его салфеткой со спиртосодержащей жидкостью и уложите в футляр.\r\n\r\n7.  Утилизация: источник питания утилизируйте в соответствии с действующим законодательством, корпус утилизируйте с пластмассовыми отходами.\r\n\r\nМЕРЫ ПРЕДОСТОРОЖНОСТИ\r\n\r\n1. Берегите термометр от падений и ударов, способных разрушить термометр, и без необходимости не вскрывайте его.\r\n\r\n2. Не погружайте корпус термометра в жидкость на глубину более 15 см и на время более 1 мин.\r\n\r\n3. Не допускайте контакта термометра с горячей водой.\r\n\r\n4. Не используйте растворители или абразивные вещества для чистки термометра.\r\n\r\n5. Избегайте попадания на термометр прямых солнечных лучей.\r\n\r\n6. Не пользуйтесь термометром вблизи сильных источников электромагнитного излучения – мониторов, телевизоров, мобильных телефонов. Это может привести к получению неточных результатов измерения.\r\n\r\nЗАМЕНА ИСТОЧНИКА ПИТАНИЯ\r\n\r\n1. Замените источник питания при появлении индикации разрядки источника питания, мерцании или самопроизвольном выключении дисплея.\r\n\r\n2. Снимите крышку корпуса термометра, закрывающую источник питания. Твердым острым предметом подцепите и удалите разряженный источник питания.\r\n\r\n3. Установите новый источник питания в соответствии с маркировкой, затем установите крышку корпуса на  место.', , 286, NULL, 'Соединённые штаты', ' Амрус Энтерпрайзес');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(19, 'Тонометр автоматический MediTech (Медитеч) MT-30, с адаптером', 5, 'Описание\r\nТонометр автоматический на плечо с интеллектуальной системой измерения IQ system МТ-30 без адаптера\r\nАвтоматический тонометр MediTech МТ-30 предназначен для измерения систолического и диастолического давления и частоты пульса осциллометрическим способом.\r\nОсобенности:\r\n• Технология интеллектуального измерения IQ system учитывает ЧСС (частоту сердечных сокращений) пользователя при измерении, определяет оптимальный уровень нагнетания манжеты для каждого человека, обеспечивая комфортное измерение и точный результат. Правильный уровень давления в манжете позволяет получить точный результат, избежать излишнего сжатия руки;\r\n• Память на 120 результатов измерений;\r\n• Цветная индикация давления по классификации ВОЗ позволяет оценить результат, определить нормальное давление и гипертонию 1, 2 и 3 степени;\r\n• Расчет среднего давления. В соответствии с рекомендациями ВОЗ для получения наиболее точного результата прибор рассчитывает среднее давление из 3 последних измерений;\r\n• Индикатор аритмии. Помогает выявить нарушения сердечного ритма на ранней стадии. При обнаружении аритмии на дисплее появляется специальный символ;\r\n• Большой жидкокристаллический дисплей;\r\n• В комплект входит стандартная манжета, на окружность руки 22-36 см.;\r\n• Возможность подключения манжет разного размера;\r\n• Индикация низкого уровня заряда источника питания;\r\n• Звуковая индикация начала и окончания измерения;\r\n• Сетевого адаптера - НЕТ\r\n• Возможность подключения сетевого адаптера (продается отдельно).\r\nОсновные характеристики:\r\nМодель МТ-30\r\nПрименение На плечо\r\nМетод измерения Осциллометрический\r\nИнтеллектуальная система IQ SYSTEM\r\nПределы измерения:\r\n-Давление в манжете от 0 до 300 мм рт. ст.\r\n-Пульс от 30 до 180 1/мин.\r\nПогрешность измерения:\r\n-Избыточное давление в манжете ±3 мм рт.ст. в диапазоне от 0 до 300 мм рт. ст.\r\n-Частота пульса ±5%\r\nФункции:\r\nИндикация аритмии Да\r\nИндикация давления По классификации ВОЗ\r\nИндикация времени Месяц, день, час, минута\r\nУсреднение результатов Последние три измерения\r\nИндикация разряда источника питания Да\r\nНагнетание Автоматическое\r\nОтключение Автоматическое\r\nСамодиагностика Индикация ошибки\r\nСохранение информации Результат измерения, дата, время\r\nГолосовой режим Нет\r\nЕмкость памяти 120\r\nРазмер ЖК дисплея 62,3 х 46,0 мм\r\nПодсветка дисплея Нет\r\nГабариты прибора, не более 140 х 90 х 48 мм\r\nРазмеры торговой упаковки 160 х 125 х 85 мм\r\nМасса прибора (без элементов питания) 221 г\r\nИсточник питания 4 элемента типа ААА\r\nНапряжение элементов питания 6В\r\nСрок жизни источника питания 2 месяца при трех измерениях в день\r\nСетевой адаптер в комплекте нет\r\nВозможность подключения сетевого адаптера да\r\nГабариты манжеты в комплекте Стандартная: на окружность руки 22-36 см\r\nРазмер пневмокамеры 220±20 х 130±10 мм\r\nВозможность использования манжет другого размера (продаются отдельно)\r\n-Увеличенная (на окруж. руки 22-40 см)\r\n-Детская (на окруж. руки 16-24 см)\r\nУсловия эксплуатации:\r\nТемпература от 10 до 40 °С\r\nВлажность (отн.) от 15 до 90 %\r\nДавление Атмосферное давление\r\nУсловия хранения:\r\nТемпература от -20 до 55 °С\r\nВлажность (отн.) от 15 до 95 %\r\nХранение Мягкий чехол\r\nМанжета стандартная на плечо состоит из пневмокамеры, соединенной со шлангом, рукава и металлической скобы. На конце шланга закреплен штуцер, предназначенный для соединения пневмокамеры манжеты с пневматической системой измерителя артериального давления цифрового при подключении его к гнезду на корпусе измерителя артериального давления цифрового. Металлическая скоба манжеты обеспечивает возможность самостоятельного закрепления манжеты на плече при проведении измерений. Крепление манжеты осуществляется текстильной застежкой \"Велкро\" (липучка).\r\nОсобые условия\r\nРекомендации\r\nДля получения конкретной информации о вашем артериальном давлении, пожалуйста, ПРОКОНСУЛЬТИРУЙТЕСЬ С ВАШИМ ВРАЧОМ.\r\nЧтобы избежать риска и ущерба, соблюдайте все предупреж дения, меры предосторожности. Используйте изделие только по назначению.\r\nПредупреждения\r\n- Изделие предназначено для использования по назначению.\r\n- Не разбирайте и не пытайтесь починить изделие.\r\n- Не пользуйтесь изделием рядом с сотовыми телефонами и другими устройствами, которые генерируют сильные электрические или электромагнитные поля, так как это может привести к ошибкам измерения или стать источником помех для изделия.\r\n- Люди с проблемами циркуляции крови могут испытывать дискомфорт при использовании изделия.\r\n- Обратитесь к врачу, если результаты измерения регулярно указывают на аномальные показания.\r\n- Не пытайтесь самостоятельно лечить подобные симптомы без консультации врача.\r\n- Не применяйте одновременно новые и старые элементы питания.\r\n- Замените элементы питания при появлении на экране индикатора низкого заряда.\r\n- Устанавливайте элементы питания, соблюдая указанную полярность.\r\n- Не применяйте одновременно элементы питания различного типа. Используйте долговечные алкалиновые элементы питания.\r\n- Удалите элементы питания, если изделие не используется более трех месяцев.\r\n- Утилизацию элементов питания выполняйте согласно местным законам.\r\nКомплектация\r\n1. Измеритель артериального давления цифровой МТ-30 - 1 шт.\r\n2. Манжета стандартная на плечо - 1 шт.\r\n3. Чехол мягкий - 1 шт.\r\n4. Элементы питания типа ААА - 4 шт.\r\n5. Руководство по эксплуатации - 1 шт.\r\nПоказания\r\nПрибор рекомендуется в качестве средства контроля артериального давления, частоты сердечных сокращений и для динамических наблюдений за этими параметрами в медицинских учреждениях и в домашних условиях.\r\nСпециальные требования к квалификации персонала, применяющего данное изделие, отсутствуют.\r\n- Для оценки состояния сердечно-сосудистой системы (на профилактических осмотрах);\r\n- При патологии сердечно-сосудистой и мочевыделительной систем;\r\n- При потере сознания пациента, при жалобах на головную боль, слабость, головокружение;\r\n- При периодическом контроле артериального давления;\r\nПротивопоказания\r\n- Выраженный отек конечности, на которой проводят измерение (приводит к изменению результата);\r\n- Снижение перфузии, ишемия или инфильтрация конечности;\r\n- Установленный периферический венозный или артериальный катетер;\r\n- Врожденные уродства;\r\n- Парез;\r\n- Перелом руки;\r\n- Измерение на стороне удаленной грудной железы.\r\nИзделие не предназначено для измерения давления у новорожденных, людей с ограниченными возможностями.\r\nПобочные действия\r\nПобочные эффекты от применения изделия отсутствуют.', , 2349, NULL, 'Китай', 'Медикал Текнолоджи Продактс');
