(20, 'Тест-полоски Сателлит Экспресс, 50 шт', 5, 'Тест-полоска Сателлит Экспресс к глюкометру, 50 шт.\r\n\r\n\r\nОпределение уровня глюкозы в тест-полосках основано на электрохимическом методе. Каждая полоска служит для проведения одного измерения.\r\n\r\n    10 мкл крови.\r\n    Электрохимический метод определения гликемии.\r\n    Каждая тест-полоска в индивидуальной упаковке.\r\n', , 542, 17, 'Россия', 'Элта ЗАО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(21, 'Ля Рош Позе Липикар АР+M бальзам 200мл', 6, 'Ля Рош Позе Липикар АП+М бальзам липидовосполняющий тройного действия для лица и тела 200 мл (La Roche-Posay, Lipikar)\r\n\r\nМГНОВЕННО УСПОКАИВАЕТ СУХУЮ КОЖУ, УМЕНЬШАЕТ ЗУД И РАЗДРАЖЕНИЕ В ТЕЧЕНИЕ 24 ЧАСОВ\r\nМГНОВЕННО УСПОКАИВАЕТ СУХУЮ КОЖУ, УМЕНЬШАЕТ ЗУД И РАЗДРАЖЕНИЕ В ТЕЧЕНИЕ 24 ЧАСОВ', , 1337, NULL, 'Франция', 'Ля Рош Позе');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(22, 'Ля Рош Позе Цикапласт Бальзам B5 ср-во успок.мультивосст, 40мл', 6, 'ICAPLAST BAUME B5\r\nУСПОКАИВАЮЩИЙ МУЛЬТИВОССТАНАВЛИВАЮЩИЙ БАЛЬЗАМ\r\n\r\nВосстанавливающее и заживляющее средство для сверхчувствительной и/или склонной к атопии кожи младенцев, детей и взрослых.\r\n\r\n• улучшает процесс восстановления кожи и обладает антибактериальными свойствами\r\n• успокаивает сухие, раздражённые участки кожи\r\n• защищает кожу, благодаря насыщенной питательной текстуре\r\n• текстура не жирная, нелипкая, не оставляет белых следов\r\n\r\nЦикапласт Б5 – это успокаивающее мультивосстанавливающее средство для сверхчувствительной и/или склонной к атопии кожи младенцев, детей и взрослых. Формула создана на основе Термальной воды La Roche-Posay и Пантенола (Провитамина В5) в концентрации 5%.\r\n\r\nКроме ранозаживляющего действия, средство оказывает противовоспалительный и антибактериальный эффект, устраняет жжение, успокаивает сухие и раздраженные участки. Насыщенная, питательная текстура защищает кожу, является барьером, препятствующим попаданию бактерий на поверхность.\r\n\r\n■ Пантенол 5% / PANTHENOL – провитамин B5: успокаивает кожу, обладает противовоспалительным действием, ускоряет заживление\r\n■ Комплекс «Медь+Марганец+Цинк» – антибактериальный компонент\r\n■ Мадекассосид / MADECASSOSIDE – растительный экстракт, способствующий регенерации дермы, активизирует защиту основных волокон дермы\r\n■ Масло Карите / SHEA BUTTER – имеет сродство со структурой кожи и обеспечивает естественное восполнение гидролипидной мантии на поверхности эпидермиса, интенсивно увлажняет, смягчает, снимает раздражение\r\n\r\nAQUA / WATER\r\nHYDROGENATED POLYISOBUTENE\r\nDIMETHICONE\r\nGLYCERIN\r\nBUTYROSPERMUM PARKII BUTTER / SHEA BUTTER\r\nPANTHENOL\r\nBUTYLENE GLYCOL\r\nALUMINUM STARCH OCTENYLSUCCINATE\r\nPROPANEDIOL\r\nCETYL PEG/PPG-10/1 DIMETHICONE\r\nTRISTEARIN\r\nZINC GLUCONATE\r\nMADECASSOSIDE\r\nMANGANESE GLUCONATE\r\nMAGNESIUM SULFATE\r\nDISODIUM EDTA\r\nCOPPER GLUCONATE\r\nACETYLATED GLYCOL STEARATE\r\nPOLYGLYCERYL-4 ISOSTEARATE\r\nSODIUM BENZOATE\r\nPHENOXYETHANOL\r\nCHLORHEXIDINE DIGLUCONATE\r\nCI 77891 / TITANIUM DIOXIDE\r\n', , 1156, 33, 'Франция', 'Ля Рош Позе');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(23, 'Ля Рош Позе Гидрафаз HA крем д/лица легкий для норм. и комб.к. 50мл', 6, 'Легкий крем HYDRAPHASE HA\r\n\r\nЭКСПЕРТИЗА:\r\n\r\nОбезвоженность – временное состояние дефицита влаги, свойственное любому типу кожи, которое проявляется шелушением и чувством стянутости. Гиалуроновая кислота, полученная путем биоферментации растительных сахаров, в составе интенсивного увлажняющего средства HYDRAPHASE HA Легкий крем, обеспечивает интенсивное увлажнение кожи в течение 72 часов.\r\n\r\nПОКАЗАНИЯ К ПРИМЕНЕНИЮ:\r\n\r\nПоявление признаков обезвоженности кожи: ощущения стянутости, сухости, тусклый цвет лица.\r\n\r\nСВОЙСТВА:\r\n\r\nФормула, обогащенная [ГИАЛУРОНОВОЙ КИСЛОТОЙ] натурального происхождения, увлажняет кожу в течение 72 часов и придает коже заметную гладкость и сияние. [ТЕРМАЛЬНАЯ ВОДА LA-ROCHE POSAY] уменьшает чувство дискомфорта и защищает кожу.\r\n\r\nЭКОЛОГИЧНОЕ ПРОИЗВОДСТВО:\r\n\r\nУглеродно-нейтральная фабрика. 100% газа и электричества для производства получены из зеленых источников.\r\n\r\nРЕЗУЛЬТАТ:\r\n\r\nКожа интенсивно увлажнена, заметно более гладкая и сияющая.\r\n\r\nПротестировано под контролем дерматологов.\r\n\r\nСпециальный герметичный дозатор препятствует попаданию воздуха для оптимальной защиты формулы средства.\r\n\r\n\r\nПОЛНЫЙ СПИСОК ИНГРЕДИЕНТОВ\r\n\r\nAQUA/WATER/EAU\r\nGLYCERIN\r\nCAPRYLIC/CAPRIC\r\nTRIGLYCERIDE\r\nLAUROYL LYSINE\r\nC15-19 ALKANE\r\nMYRISTYL MYRISTATE\r\nAMMONIUM POLYACRYLOYLDIMETHYL TAURATE\r\nSTEARIC ACID\r\nPOTASSIUM CETYL\r\nPHOSPHATE\r\nGLYCERYL STEARATE SE\r\nSODIUM HYALURONATE\r\nSODIUM HYDROXID\r\nMYRI STIC ACI D\r\nPALMITIC ACID\r\nHYDROLYZED HYALURONIC ACID\r\nCAPRYLOYL\r\nGLYCINE\r\nCAPRYLYL GLYCOL\r\nXANTHAN GUM\r\nPENTAERYTHRITYL TETRA-DI-T-BUTYL HYDROXYHYDROCINNAMATE\r\nPARFUM / FRAGRANCE. (CODE F.I.L.: B251280/1)\r\n', , 1942, NULL, 'Франция', 'Ля Рош Позе'),
(24, 'Топикрем (Topicrem) гель 2в1 очищающий для детей 500 мл', 6, 'Очищающий гель 2 в 1 для детей 500мл\r\n\r\nЧувствительная кожа\r\nУход за детской кожей с первых дней жизни\r\nНоворожденные - Младенцы - Дети\r\nРазработан для очищения тела и волос новорожденных, младенцев и детей младшего возраста. Подходит для чувствительной кожи. Протестирован под контролем дерматологов. Не содержит парабенов, мыла, спирта. Не сушит кожу, не раздражает глаза. Гипоаллергенно. Hанести гель на влажную кожу тела и волосы, вспенить и тщательно смыть. Промокните полотенцем, уделяя внимание складкам кожи.\r\n\r\nсостав\r\nAQUA (WATER) . GLYCERIN . SODIUM LAURETH SULFATE . SODIUM\r\nCOCOAMPHOACETATE . PEG-200 HYDROGENATED GLYCERYL PALMATE . PEG-7\r\nGLYCERYL COCOATE . CITRIC ACID . SODIUM SULFATE . SODIUM BENZOATE . SODIUM\r\nCHLORIDE . PARFUM (FRAGRANCE)\r\n', , 1544, 34, 'Франция', 'Лаборитория Нижи');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(25, 'Бинт эластичный Консумед (Consumed) средней растяжимости с застежкой 1,5м х80мм', 7, 'Бинт медицинский эластичный компрессионный РС 8см х 1,5 м\r\nПредназначен для проведения компрессионной терапии в различных областях практической хирургии (сердечно-сосудистой, абдоминальной, торакальной, пластической и др.), а также в травматологии, ортопедии, спортивной медицине.\r\n\r\nОбработанный край бинта обеспечивает аккуратный внешний вид при использовании и способствует увеличению срока службы изделия.\r\n\r\nКомплектация «С клипсами».\r\n\r\nСостав сырья: хлопок-58%, полиэфир-23%, латекс-19%.\r\n\r\nПоказания к применению: бинт средней растяжимости – для профилактики и лечения варикоза вен, хронических тромбофлебитов, вывихов, растяжений. В профилактических целях – для избавления от перегрузок и переутомления при физической нагрузке, для профилактики растяжений и травм при занятиях спортом.\r\n\r\nПредостережение! Появление онемения, болей, ощущения пульсации говорят о выборе не соответствующей компрессии бинта или необходимости перебинтовывания.\r\n\r\nПротивопоказания: индивидуальная несовместимость с компонентами сырья изделия.\r\n\r\nСанитарно гигиеническая обработка: следует обрабатывать ручной стиркой в мыльном растворе при температуре от +35 до +40 ºС без использования средств, содержащих отбеливатели. Не применять чистку с химическими препаратами. Рекомендовано аккуратное отжимание без выкручивания и сушка в расправленном виде. Запрещено глажение.\r\n\r\nХранение: в сухом помещении при комнатной температуре.', , 133, NULL, 'Россия', ' АЛЬМЕД, ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(26, 'Массажер-варежка полимерный Варюша', 7, 'Массажер-варежка Дельтатерм \"Варюша\",\r\n\r\nМассажер \"Варюша\" подарит вашей коже здоровье, а здоровая кожа - это необходимое условие безупречного внешнего вида. Два удовольствия в одном изделии: мягкий поверхностный пилинг и антицеллюлитный массаж! Варюшу можно использовать в душе вместо мочалки, а также в сауне или бане. Массажер является принципиально новым средством стимулирующим физиологические процессы кожи. Он имеет двойное действие:\r\n\r\nМягко удаляет загрязнения и отмершие чешуйки эпидермиса, успокаивает и освежает кожу, усиливает обменные процессы, снимает чувство напряжения и усталости\r\nМассирует тело и устраняет проявления целлюлита\r\n\r\nВо время принятия душа энергичными круговыми движениями пройтись массажной варежкой по бедрам, животу, ягодицам, коленям и спине.\r\n\r\nВарюша имеет две поверхности:\r\nОдна поверхность с мягкой текстурой, которая используется для ежедневной очистки кожи, пилинга;\r\nВторая поверхность с крупной текстурой для проведения антицеллюлитного массажа, который необходимо проводить круговыми движениями, начиная с икр ног и вверх к животу и рукам.\r\n\r\nМикросферы при массаже активизируют обмен веществ кожи, оказывая на нее освежающее и тонизирующее средство. Массажер нежно удаляет ороговевшие клетки, нормализует обменные процессы, стимулирует естественное обновление клеток, улучшает цвет лица. Результат - кожа становится эластичной, гладкой, выглядит молодой и здоровой.', , 205, NULL, 'Россия', 'Дельта-Терм ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(27, 'Унга-Рус наколенник компрессионный, размер 2', 7, 'Наколенник компрес. р.2 Унга-Рус С327\r\n\r\nЛекарственная форма\r\n\r\nнаколенник\r\n\r\nразмер 2 обхват ниже колена 32-35 обхват колена 32-36 обхват выше колена 42-48\r\n\r\nСостав\r\n\r\nхлопок 80%; ПЭФ 10%; латекс 10%\r\n\r\nПоказания\r\n\r\nНаколенник предназначен для профилактики и лечения травм колена и варикозного расширения вен с локализацией варикозных вен под коленом. Может использоваться в качестве мягкого фиксирующего средства после операций на коленном суставе.', , 244, NULL, 'Латвия', 'Тонус');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(28, 'Трость Аверсус 528 деревянная с пластмассовой ручкой', 7, 'Трость деревянная с пластмассовой ручкой.\r\nАртикул: 528\r\n\r\nТрость опорная предназначена для дополнительной опоры и облегчения передвижения людей имеющих травмы и заболевания нижних конечностей.\r\n\r\nТрадиционная деревянная опорная трость изготовлена из березы и покрыта несколькими слоями нитролака, ручка из пластмассы.\r\n\r\nРезиновый наконечник имеет внутренний диаметр 22 мм, внешний 45 мм, что обеспечивает надежное сцепление с поверхностью.\r\n\r\nВозможно самостоятельное укорачивание трости: снять резиновый наконечник и отпилить лишнее.\r\n\r\n    Длина трости 830-940 мм.\r\n    Вес трости – 380 гр.\r\n    Выдерживает нагрузку до 100 кг.\r\n\r\n\r\nПеред применением проконсультируйтесь с врачом.\r\nДанное изделие может быть изготовлено по индивидуальным размерам, а также под вес пользователя до 150 кг.', , 513, 32, 'Россия', 'Аверсус'),
(29, 'Zero White (Зеро Вайт), зубная паста Сенситив для чувствительных зубов, 100г', 8, 'Уменьшает чувствительность зубов\r\nУкрепляет защитные функции эмали\r\n\r\nПаста для ухода за зубами с тонкой и чувствительной эмалью. Лактат алюминия уменьшает болезненную чувствительность зубов, способствует снижению кровоточивости десен. Фтор и морская соль укрепляют и повышают защитные функции эмали, предотвращают появление кариеса. Бисаболол и аллантоин увлажняют мягкие ткани и оказывают успокаивающее действие на слизистую оболочку полости рта. Приятный аромат оставит ощущение свежести и чистоты надолго.\r\n\r\n*свойства пасты обусловлены входящими в состав компонентами\r\n\r\nСостав:\r\nAqua, Calcium Carbonate, Sorbitol, Hydrated Silica, PEG-400, Sodium Lauryl Sulfate, Cellulose Gum, Xanthan Gum, Menthol, Maris Sal, Allantoin, Aluminum Lactate, Aroma (ароматизатор), Sodium Saccharin, Bisabolol, Sodium Fluoride, 2-omo-2-Nitropropane-1,3-Diol. Массовая доля фторида 0,05% в пересчете на F-.\r\n\r\nСпособ применения: небольшое количество зубной пасты нанести на зубную щетку, чистить зубы в течение 1,5-2 минут, затем тщательно прополоскать рот водой. Не глотать. Рекомендуется взрослым и детям старше 12 лет. Не использовать при индивидуальной непереносимости любого из компонентов.', , 199, NULL, 'Россия', 'Вилсен Групп');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(30, 'IRIS (ИРИС), прокладки ежедневные Панти классик, 20шт', 8, 'Состав:\r\nнетканый материал, распушенная целлюлоза, полиэтиленовая пленка, клей, силиконизированная бумага.\r\n\r\nАнатомическая форма позволяет прокладке надежно крепиться на белье и не сминаться во время использования. Благодаря нежнейшей «дышащей» поверхности надолго сохраняется ощущение свежести и чистоты.\r\n\r\nНазначение: прокладки предназначены для ежедневной личной гигиены женщин. Регулярно меняйте прокладку по мере ее наполнения.\r\n\r\nПравила хранения: рекомендуется хранить в прохладном месте, при комнатной температуре.\r\n', , 72, NULL, 'Россия', 'Хайджин текнолоджиз');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(31, 'Платочки бумажные Консумед (Consumed) трехслойные, 10 х10шт', 8, 'Платочки бумажные ТМ Consumed®  3-х сл.\r\nсостав\r\n100% целлюлоза\r\n\r\nСпособ применения и дозы\r\nВ качестве изделия санитарно-гигиенического назначения.', , 150, NULL, 'Россия', 'Бумфа Групп');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(32, 'Салфетки влажные Консумед (Consumed) антибактериальные с экстрактом ромашки, 20 шт', 8, 'Влажные антибактериальные салфетки с экстрактом ромашки 20 шт\r\nсостав\r\nНетканое полотно спанлейс, лосьон пропитывающий: Вода деминерализованная, Кокамидопропилбетаин, Полиаминопропилбигуанид, Феноксиэтанол, Бисаболол.\r\n\r\nСпособ применения и дозы\r\nОткрыть клапан и извлечь салфетку. Плотно закрыть защитный клапан. Салфетки предназначены для одноразового использования, только для наружного применения. Не допускать попадания в глаза, рот и на поврежденные участки кожи, в случае попадания промыть водой. При обнаружении повышенной индивидуальной чувствительности к компонентам лосьона рекомендуется прекратить использование.', , 56, NULL, 'Россия', 'Гранд А.В.');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(33, 'Вата хирургическая стерильная Ника, 100г', 9, 'Вата медицинская гигиеническая - изготавливается из 100% хлопка, без добавок и примесей, предназначена для всевозможных медицинских манипуляций, связанных с обработкой ран, а также для снятия макияжа, ежедневного гигиенического ухода, как для детей, так и для взрослых.Обеспечивает максимальный впитывающий и очищающий эффект. Подходит для любых типов кожи и не имеет противопоказаний.', , 82, NULL, 'Россия', 'Ника АОЗТ ф-ка мед.изд.и матер.');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(34, 'Перекись водорода Консумед (Consumed), раствор для наружного применения 3%, спрей 150мл', 9, 'Средство предназначено для:\r\n\r\nдезинфекции и мытья поверхностей в помещениях, жесткой мебели, предметов обстановки, поверхностей аппаратов, приборов, санитарно-технического оборудования, белья, посуды (в том числе одноразовой и лабораторной), предметов для мытья посуды, резиновых и полипропиленовых ковриков, уборочного инвентаря и материала, игрушек, спортивного инвентаря, предметов ухода за больными, предметов личной гигиены в ЛПУ и ЛПО (включая клинические, диагностические и бактериологические лаборатории, отделения неонатологии, роддома, палаты новорожденных и пр.), в детских и пенитенциарных учреждениях, в инфекционных очагах при проведении текущей, заключительной и профилактической дезинфекции;\r\n\r\nдезинфекции кувезов и приспособлений к ним, комплектующих деталей наркозно- дыхательной, ингаляционной аппаратуры, анестезиологического оборудования;\r\n\r\nдля дезинфекции медицинских отходов - изделий медицинского назначения однократного применения, перевязочного материала, белья одноразового применения и т.д. перед их утилизацией в ЛПУ и ЛПО;\r\n\r\nдезинфекции стоматологических оттисков из альгинатных, силиконовых материалов, полиэфирной смолы, зубопротезных заготовок из металлов, керамики, пластмасс и других материалов, отсасывающих систем стоматологических установок, слюноотсосов и плевательниц; дезинфекции изделий медицинского назначения (включая хирургические и стоматологические инструменты, в том числе вращающиеся, жесткие и гибкие эндоскопы, инструменты к эндоскопам) ручным способом;\r\n\r\nдезинфекции, совмещенной с предстерилизационной очисткой, изделий медицинского назначения (включая хирургические и стоматологические инструменты, в том числе вращающиеся, инструменты к эндоскопам) ручным и механизированным (в ультразвуковых установках любого типа) способами;\r\n\r\nдезинфекции, совмещенной с предстерилизационной или окончательной (перед дезинфекцией высокого уровня /ДВУ/) очисткой, гибких и жестких эндоскопов ручным и механизированным (в специализированных установках, например, «КРОНТ-УДЭ») способами; дезинфекции высокого уровня эндоскопов, используемых при нестерильных эндоскопических манипуляциях; стерилизации ИМИ (в т.ч. хирургических инструментов, стоматологических инструментов и материалов, инструментов к эндоскопам, эндоскопов, используемых при стерильных эндоскопических манипуляциях);\r\n\r\nпредстерилизационной очистки, не совмещенной с дезинфекцией, изделий медицинского назначения (включая инструменты к эндоскопам, хирургические и стоматологические инструменты, в том числе вращающиеся, а также стоматологические материалы) ручным и механизированным (в ультразвуковых установках любого типа) способами;\r\n\r\nпредстерилизационной очистки, не совмещенной с дезинфекцией, жестких и гибких эндоскопов ручным и механизированным (в специализированных установках, например, «КРОНТ-УДЭ») способами;\r\n\r\nокончательной очистки эндоскопов перед ДВУ ручным и механизированным (в специализированных установках, например, «КРОНТ-УДЭ») способами;\r\n\r\nпредварительной очистки эндоскопов;\r\n\r\nдезинфекции санитарного транспорта и транспорта для перевозки пищевых продуктов;\r\n\r\nдезинфекции обуви из резин, пластика и других полимерных материалов с целью профилактики инфекций грибковой этиологии (дерматофитии);\r\n\r\nпроведения генеральных уборок в лечебно-профилактических, детских дошкольных и школьных и других общеобразовательных и оздоровительных учреждениях, на коммунальных объектах пенитенциарных и других учреждениях;\r\n\r\nборьбы с плесенью; дезинфекции воздуха способом распыления на различных объектах;\r\n\r\nпрофилактической дезинфекции систем вентиляции и кондиционирования воздуха (бытовые кондиционеры, сплит системы, мультизональные сплитсистемы, крышные кондиционеры, вентиляционные фильтры воздуховоды и др.);\r\n\r\nдезинфекции и мытья помещений и оборудования (в том числе оборудования, имеющего контакт с пищевыми продуктами) на предприятиях общественного питания, продовольственной торговли, потребительских рынках, коммунальных объектах, гостиницах, общежитиях, бассейнах, аквапарках, банях, саунах, местах массового скопления людей;\r\n\r\nдезинфекции помещений, оборудования, инструментов, спецодежды, воздуха парикмахерских, массажных и косметических салонов, салонов красоты, прачечных, клубов, санпропускников и других объектов сферы обслуживания населения.\r\n\r\nМеры предосторожности: средство используют только для наружного применения. Избегать попадания в глаза. По истечении указанного срока годности использование запрещается. Применять строго по назначению. Комплектация с насадкой-распылителем.\r\n\r\nУсловия хранения: хранить в плотно закрытой упаковке производителя при температуре от 0°С до +30°С; вдали от источников тепла и возгорания; избегать хранения на прямом солнечном свете. Не курить! Хранить отдельно от лекарств, в местах недоступных детям.', , 82, NULL, 'Россия', 'Самарамедпром');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(35, 'Фурацилин Консумед (Consumed) порошок 20мг, 20 шт', 9, 'Фурацилин ср-во дезинф. пор. 20мг №20\r\n\r\nЛекарственная форма\r\n\r\nжелтовато-зелёный микрокристаллический порошок с горьким вкусом, со специфическим запахом\r\n\r\nСостав\r\n\r\nнитрофурал (фурацилин), натрия хлорид\r\n\r\nФармакологическое действие\r\n\r\nФурацилин - порошок для приготовления раствора для наружного применения.\r\n\r\nАнтисептик. Бактерицидное действие при полосканиях, орошениях и аппликациях\r\n\r\nВ медицине это противомикробное средство используют для лечения микробных инфекций ЛОР — органов и глаз, промывания плевральных полостей, для предотвращения инфицирования и процессов разложения на поверхности открытых ран.\r\n\r\nФурациллин для полоскания горла часто назначают при лечении ангины и тонзиллита. Препарат обеспечивает выраженное антисептическое и антимикробное действие, при регулярных полосканиях способствует вымыванию патогенной микрофлоры и гнойных выделений, останавливает рост и размножение бактерий.\r\n\r\nОсновными патологическими состояниями, требующими наружного применения Фурацилина, являются:\r\n\r\nнезначительные повреждения кожного покрова (ранки, царапины, порезы, ссадины);\r\n\r\nгнойные раны;\r\n\r\nпролежни;\r\n\r\nожоги и обморожения (2 и 3 степени).\r\n\r\nМестное применение Фурацилина рекомендуется при следующих заболеваниях:\r\n\r\nвоспалительные процессы в полости рта (гингивиты, стоматиты);\r\n\r\nвоспалительные поражения глаз (конъюнктивиты, блефариты);\r\n\r\nфурункулы наружного слухового прохода или острый отит (наружный, средний);\r\n\r\nостеомиелит;\r\n\r\nострый тонзиллит;\r\n\r\nгнойно-воспалительные процессы в суставных или плевральных полостях.\r\n\r\nПобочные действия\r\n\r\nАллергические дерматозы, повышенная чувствительность к нитрофуралу и другим производным нитрофурана.\r\n\r\nОсобые условия\r\n\r\nПри случайном попадании средства в желудок рекомендуется выпить несколько стаканов воды с добавлением адсорбента (например, 10-15 измельчённых таблеток активированного угля на стакан воды).\r\n\r\nРвоту не вызывать!\r\n\r\nПри необходимости обратится за врачебной помощью.\r\n\r\nПоказания\r\n\r\nЭту форму препарата используют для промывания глаз, ротовой полости и горла, мочевого пузыря и мочеиспускательного канала.\r\n\r\nВодные растворы Фурацилина предназначены для обеззараживания полостей при гнойном плеврите, гайморите и в послеоперационом периоде при остеомиелите.\r\n\r\nПротивопоказания\r\n\r\nПовышенная чувствительность к компонентам препарата, кровотечение, аллергодерматозы.\r\n\r\nС осторожностью:\r\n\r\nВыраженные поражения функции почек.\r\n\r\nБеременность и лактация:\r\n\r\nПрименение при беременности и в период грудного вскармливания возможно, если предполагаемая польза для матери превышает потенциальный риск для плода или ребенка.\r\n\r\nДозировка\r\nИспользовать только для наружного применения.\r\n\r\n1 порошок растворить в 100 мл горячей воды, или 2 порошка растворить в 200 мл горячей воды.\r\n\r\nПолоскания горла при ангине делают в течение 5-7 минут до 10 раз в сутки, каждый раз используя по 100 мл готового раствора.\r\n\r\nЕсли процедуру необходимо сделать ребенку, родители должны научить его, как правильно полоскать воспаленное горло и следить за тем, чтобы малыш случайно не проглотил раствор. Совсем маленьким детям, которые еще не умеют самостоятельно полоскать горло, можно обрабатывать пораженные участки из спринцовки.\r\n\r\nПри воспалительных процессах в ротовой полости (стоматите, гингивите) раствор для полосканий готовят по той же схеме, что и для горла. Дезинфицирующие свойства Фурацилина эффективно снимают неприятные симптомы заболеваний и улучшают состояние больного. Полоскать рот Фурацилином рекомендуется каждый раз перед проведением очередной лечебной манипуляции.', , 139, NULL, 'Россия', '\r\nСамарская фармфабрика');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(36, 'Пластырь Консумед (Consumed) фиксирующий на тканевой основе 2,5см х500см №1', 9, 'Лейкопластырь медицинский фиксирующий на тканевой основе 2,5х5\r\nПредназначен для неинвазивного сцепления с поверхностью кожи с целью фиксации повязок на месте или прикрепления предметов (например, катетера).\r\nПротивопоказания: абсолютных противопоказаний не выявлено, кроме случаев индивидуальной непереносимости компонентов пластыря.\r\n\r\nСпособ и условия применения: извлечь пластырь из упаковки, отделить нужную длину, наклеить пластырь на чистую сухую здоровую поверхность кожи и фиксируемый предмет.\r\n', , 89, NULL, 'Латвия', '\r\nНордеПласт, ООО');
INSERT INTO `products` (`id`, `name`, `category`, `desc`, `image`, `price`, `discount`, `country`, `Manufacturer`) VALUES
(37, 'Тест для определения беременности Nefella высокочувствительный, 2 шт', 10, 'Тест на беременность струйный\r\nТочность:\r\nСвыше 99%, если тест используется со дня ожидаемого начала менструации.\r\n\r\nПринцип действия:\r\nВо время беременности организм женщины вырабатывает гормон беременности - ХГЧ (хорионический гонадотропин человека). На ранних стадиях беременности количество ХГЧ в организме увеличивается очень быстрыми темпами и через 1-2 недели после зачатия достигает концентрации 25-100 мМЕ/мл. Зачатие происходит в момент овуляции, т.е. примерно в середине менструального цикла. Таким образом, на момент тестирования концентрация ХГЧ как минимум вдвое превышает порог чувствительности теста.\r\n\r\nСроки тестирования:\r\nИмеют чувствительность 12,5 мМЕ/мл и предназначены для использования на ранних сроках беременности, с первого дня задержки. В случае тестирования до задержки и получения результата «вы не беременны», существует вероятность, что беременность есть. Для полной уверенности рекомендуется провести повторное тестирование в день предполагаемого начала менструации.\r\n\r\nОбязательно ли использовать утреннюю мочу?\r\nСо дня ожидаемого начала менструации тест можно проводить в любое время суток. Если тестирование проводится раньше ожидаемого срока менструации, рекомендуется использовать утреннюю мочу этого дня, поскольку утром концентрация гормона ХГЧ максимальна. Перед проведением теста избегайте чрезмерного употребления жидкостей и мочегонных средств. В противном случае, если во время раннего тестирования получен результат «вы не беременны», возможно, что уровень гормона ХГЧ ещё недостаточно высок для обнаружения.\r\n\r\nУсловия хранения:\r\nХранить при температуре от 4 до 30°С в запечатанной упаковке вдали от источников тепла в недоступном для детей месте.\r\n\r\nКак рассчитать предполагаемый день начала менструации?\r\nЧтобы рассчитать день предполагаемого начала менструации, используйте свою обычную продолжительность цикла, считая количество дней с первого дня менструации до последнего дня перед началом следующей менструации. Если цикл нерегулярный, необходимо учитывать самый длинный цикл за последние месяцы. Если вы не можете рассчитать, когда должна начаться менструация, рекомендуется проводить тестирование не ранее чем через 19 дней после последнего незащищённого полового акта.\r\n\r\nПроцедура проведения теста\r\n\r\nТест-полоска\r\n• Извлеките тест-полоску из пакета, держа её за окрашенный конец\r\n• Погрузите тест-полоску вертикально в чистую емкость с мочой до отметки, указанной стрелками, на 10 секунд\r\n• Положите тест-полоску на сухую горизонтальную поверхность\r\n• Оцените результат через 3-5 минут, но не позднее чем через 10 минут\r\n\r\nСтруйный тест\r\n• Извлеките из пакета струйный тест\r\n• Снимите защитный колпачок\r\n• Держите приемную часть теста направленной вниз под струёй мочи в течение 5-7 секунд\r\n• Наденьте защитный колпачок\r\n• Положите тест на сухую горизонтальную поверхность\r\n• Оцените результат через 3-5 минут, но не позднее чем через 10 минут\r\n  \r\nОценка результата\r\n\r\nОтрицательный – ВЫ НЕ БЕРЕМЕННЫ\r\nЕсли в зоне контроля в течение 10 минут появится одна линия, то тест выполнен правильно и беременности нет.\r\nПоложительный – ВЫ БЕРЕМЕННЫ\r\nЕсли в течение 5-10 минут в зоне контроля появляются две линии, то тест выполнен правильно – беременность есть. Даже бледная вторая линия свидетельствует о положительном результате.\r\nОшибочный – ТЕСТ ВЫПОЛНЕН НЕПРАВИЛЬНО\r\nЕсли не появляется ни одной линии, то тестирование выполнено неправильно - попало слишком много, либо слишком мало мочи (именно для этого в тестах есть контрольная линия). В этом случае необходимо повторить тест.\r\n\r\nМогут ли повлиять на результаты какие-либо лекарства или заболевания?\r\n• Препараты для лечения бесплодия, содержащие гормон ХГЧ, могут стать причиной ошибочных результатов (такие препараты вводятся обычно в виде инъекций, и тестирование в течение небольшого срока после инъекции может привести к ложному результату «вы беременны»).\r\n• Другие препараты для лечения бесплодия (например, кломифена цитрат), обезболивающие препараты, гормональная контрацепция (например, противозачаточные таблетки) не должны влиять на результат.\r\n• Если вы недавно перестали использовать гормональную контрацепцию или принимаете такие средства для лечения бесплодия, как кломифена цитрат, ваш менструальный цикл может быть нерегулярным, следствием чего может стать преждевременное тестирование.\r\n• Если вы недавно были беременны (даже если вы не выносили ребёнка в течение полного срока), может быть получен ложный результат «вы беременны».\r\n• Внематочная беременность, киста яичника, менопауза и некоторые очень редкие заболевания могут стать причиной ошибочных результатов.\r\n• Если получен результат «вы беременны», впоследствии вы можете обнаружить, что вы не беременны, поскольку беременность может естественным образом прерваться на ранних сроках.\r\nЕсли вы получили неожиданные результаты, обсудите их со своим врачом.\r\n\r\nВнимание!\r\n• Не следует оценивать результат теста позднее чем через 10 минут\r\n• При положительном результате теста Вам следует обратиться к врачу\r\n• Если менструация задерживается, а результат двух тестирований отрицательный, вам следует обратиться к врачу', , 179, NULL, 'Россия', '\r\nКлевер ООО');
