(38, 'Контекс презервативы Lights особо тонкие №3', 10, 'Контекс пр-в Lights особо тонкие №3\r\n\r\nЛекарственная форма\r\nОсобо тонкие презервативы Сontex \"Lights\"\r\nСостав\r\nКонтекс Лайтс в силиконовой смазке с накопителем\r\n\r\nпрезервативы Сontex \"Lights\" в силиконовой смазке с накопителем.\r\n\r\nДлина: 180мм.\r\n\r\nШирина: 52мм.\r\n\r\nТолщина стенки: 0,05мм.\r\n\r\nИзготовлены из натурального высококачественного латекса.\r\nФармакологическое действие\r\nОсобо тонкие презервативы Сontex \"Lights\" в силиконовой смазке с накопителем. Презервативы сохранят естественность ощущений, не снижая уровня защиты. Не рекомендуется использовать ректально. Прозрачные из натурального латекса с гелем-смазкой.\r\n\r\nКачество презервативов Contex гарантировано использованием современного высокотехнологического оборудования и многократным, тщательным контролем\r\n\r\nна всех этапах производства. Проверено электроникой\r\n\r\nПожалуйста, перед использованием внимательно прочтите инструкцию на внутренней стороне упаковки!\r\nПобочные действия\r\nПрезервативы из натурального латекса могут вызвать аллергические реакции, включая анафилактический шок. При наличии повышенной чувствительности или аллергии на латекс - проконсультируйтесь с врачом или попробуйте презервативы из синтетического латекса.\r\n\r\nПоказания\r\nПрезервативы CONTEX® при правильном использовании являются надежным средством предотвращения нежелательной беременности и передачи заболеваний, передающихся половым путем (ЗППП), в т.ч. ВИЧ-инфекции.\r\n\r\nНикакое из средств контрацепции не гарантирует 100% защиты от нежелательной беременности, ВИЧ-инфекции или ЗППП.\r\n\r\nДозировка\r\n1. Любой из партнеров может надеть презерватив на возбужденный пенис во время предварительных ласк. Позаботьтесь о том, чтобы сделать это до начала полового акта. Это помогает предотвратить беременность и возможность заражения инфекциями, передаваемыми половым путем. ВНИМАНИЕ: проверьте срок годности на упаковке презерватива, прежде чем использовать его . Надорвите упаковку со стороны зубчатой кромки и обращайтесь с презервативами осторожно, так как его можно повредить ногтями и острыми предметами, например, ювелирными изделиями или украшениями при пирсинге. 2. Проверьте, чтобы презерватив был свернут наружу. Если он свернут наружу, то презерватив вывернут наизнанку. Сдавите сосок на конце презерватива, чтобы внутри не осталось воздуха. 3. Все еще сдавливая сосок, поместите презерватив на кончик пениса и разверните его вниз рукой. если он начнет сворачиваться во время секса, немедленно разверните его снова. Если презерватива спадет, прекратите половой акт и наденьте новый презерватив. 4. Вскоре после эякуляции и пока пенис еще возбужден, презерватив необходимо плотно придержать у основания пениса, прежде чем снять его. Затем просто снимите презерватив, заверните в бумажную салфетку и выбросьте в мусорный ящик. Пожалуйста, не спускайте его в унитаз.', , 127, NULL, ' Соединенное Королевство Великобритании и Северной Ирландии', 'Рекитт Бенкизер Хелскэр Интернешнл Лтд.');
