(39, 'Презервативы Визит для УЗИ, д/ультрозвук.исслед. №1', 10, 'Презервативы VIZIT для ректо-вагинального датчика аппарата ультразвукового исследования (УЗИ). Специально без смазки, так как для УЗИ используется особая проводящая смазка, которая несовместима с силиконовой смазкой. Без накопителя для более плотного облегания датчика аппарата УЗИ. Прозрачные, легко одеваются на датчик, не соскальзывают, не образуют складок, тем самым не вносят помех в исследование. Рекомендованы для использования со всеми видами датчиков аппарата УЗИ.\r\n\r\n\r\nУсловия хранения\r\nХранить в недоступном для детей месте при температуре от 0 до 25С. Избегать попадания прямых солнечных лучей.', , 35, NULL, 'Россия', 'Альпина пласт О');
