(40, 'Дюрекс презервативы Invisible, №3', 10, 'Дюрекс пр-в Invisible, №3\r\n\r\nЛекарственная форма\r\nпрезервативы ультратонкие\r\nСостав\r\nПрозрачные из натурального латекса с гелем-смазкой\r\n\r\n100% латекс\r\nФармакологическое действие\r\nDurex invisible – самые тонкие, почти не ощутимые презервативы для максимального удовольствия.\r\n\r\nНоминальные размеры длина - 180 мм, ширина - 52 мм\r\n\r\nПрозрачные презервативы со смазкой, особая форма с накопителем\r\n\r\nСпециальная анатомическая форма «Easy-on» (Прямой формы с накопителем)\r\n\r\nДерматологически протестированы\r\n\r\n100% проверены электроникой\r\n\r\nТонкие, почти не ощутимые с дополнительной обильной смазкой, с накопителем.Специальная анатомическая форма презерватива облегчает надевание и создаёт более комфортные ощущения. Силиконовая смазка снижает трение и делает половой акт более естественным.Если Вы любите надежность, Вам стоит попробовать эти презервативы! Прекрасно подойдет для тех, кто хочет отбросить все детали и сосредоточиться только на партнере.\r\n\r\nОсобые условия\r\nПожалуйста, внимательно прочтите памятку внутри упаковки, особенно если вы собираетесь использовать презервативы для орального или анального секса. Использование гелей-смазок Durex Play с презервативами может увеличить наслаждение от секса. Все гели-смазки Durex Play безопасны для использования с презервативами - в отличие от смазок на масяной основе, которые могут повредить презерватив. Дерматологически тестированы. Презервативы предназначены только для одноразового применения. Если вы почувствуете дискомфорт или раздражение во время использования презерватива, прекратите использование. Если симптомы будут продолжаться, пожалуйста, обратитесь к врачу.\r\nПоказания\r\nЗащита от нежелательной беременности и заболеваний, передающихся половым путем\r\n', , 373, 39, 'Соединенное Королевство Великобритании и Северной Ирландии', '\r\nРекитт Бенкизер Хелскэр Интернешнл Лтд.');

